import React from 'react';

const Table = () => {
    return (
        <div>
            <table width="100 %">
                <thead>
                    <tr>
                        <td>Item description</td>

                        <td>Quantity</td>

                        <td>Price</td>

                        <td>Amount</td>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                        <td></td>
                    </tr>
                </tbody>
            </table>
        </div>
    );
};

export default Table;
